        mParticle.logEvent(
            'Land_Campaign',
            mParticle.EventType.Unknown,
            {
                "Landing_URL": window.location.href,
                "Subject": a_utm_match[4],
                "Campaign_Name": a_utm_match[1],
                "Campaign_Medium": a_utm_match[3],
                "Publisher": a_utm_match[2]
            }
        );
    }

}

